$(document).ready(function(){
	$(".menu").on("click", function() {
	  $(".path").addClass("is-active");
	  $(".overlay").addClass("is-open");
	  $(".overlay").fadeIn();
	  $(".overlay ul li, .overlay .closeBtn").css("opacity", "1");
	  $(".overlay ul li").css({"transform":"translatey(0)"});
	  $(".closeBtn").click(function(){
		  $(".overlay").fadeOut();
		  setTimeout(function(){
			  $(".overlay").removeClass("is-open");
		  }, 700);
		  $(".overlay ul li, .overlay .closeBtn").css("opacity", "0");
		  $(".overlay ul li").css({"transform":"translatey(-50px)"});
		  $(".path, .closeBtn").removeClass("is-active");
	  });
	});
});



// 타이핑 이벤트
const $text = document.querySelector(".typing");

// 글자 모음
const letters = ["LEE.c.g Portfolio"];

// 글자 입력 속도
const speed = 150;
let i = 0;

// 타이핑 효과
const typing = async () => {  
  const letter = letters[i].split("");
  
  while (letter.length) {
	await wait(speed);
	$text.innerHTML += letter.shift(); 
  }
  
  // 잠시 대기
  await wait(1200);
  
  // 지우는 효과
  if (letters[i + 1]) remove();
}

// 글자 지우는 효과
const remove = async () => {
  const letter = letters[i].split("");
  
  while (letter.length) {
	await wait(speed);
	
	letter.pop();
	$text.innerHTML = letter.join(""); 
  }
  
  // 다음 순서의 글자로 지정, 타이핑 함수 다시 실행
  i++;
  typing();


}

// 딜레이 기능 ( 마이크로초 )
function wait(ms) {
  return new Promise(res => setTimeout(res, ms))
}

// 초기 실행
setTimeout(typing, 3000);


